import React from "react";

const ArticleModal = ({ article, inClose }) => {
  if (!article) return null;

  return (
    <div className="modal">
      <div className="modal-content">
        <h2>{article.title}</h2>
        <p>{article.content}</p>
      </div>
    </div>
  );
};

export default ArticleModal;
